import React from 'react'

function Todo({ todo, removeTodo, resolvedTodo }) {
    return (
        <div>
            <p>{todo.task}</p>{' '}
            <button onClick={() => removeTodo(todo.id)}>X</button>
            <input type="checkbox" onClick={() => resolvedTodo(todo.id)} />
        </div>
    )
}

export default Todo
